description:
So hello everyone, I'm from Ukraine, and this is my first sharing.

In 2006 I founded myself in love with cyberpunk and experimental music, so I maded a band called &quot;faCULTy&quot;
Soon we've maded first album, containig a lot of cyber stylish music, enspired by William Gibson's &quot;Mona Liza Overdrive&quot; and &quot;Ghost in the shell&quot; series.

Then, in the end of 2007 I've started to work on my own project, called DJ S.I.C.

For now, I've made something about 10 albums in different styles, and few singles.
I think, I will never try to sell my music - from the start, I shared it through ukrainian and russian cyberpunk communities, and people, who like some experimental dark DIY stuff.

So, here is your turn) It's free, and it's here, on TPB.

Realy care about your opinion, plz seed and comment.

Tnx.



